import React from "react";

function Copy(props){
    return (
        <div className="App">

       <p>{props.text}</p>       
       <button onClick={() => {
         navigator.clipboard.writeText(props.text);}}>
        Copy
       </button>
     </div>
    )
}

export default Copy;
